import React from 'react';
import "./section2.css";

function exchangeInfoCard() {
    return (
      <div className="liberty__share">
        <div className="wrapper">
          <h2 className="liberty__ldr">Liberty Share</h2>
          <div className="ldr">
          <h2 className="liberty__ldr">LDS</h2>
            <h2 className="liberty__ldr">LBB</h2>
            <img src="../../Images/assets/LUSD.png"></img>
          </div>
          <h1 className="ldr__price">$81.4</h1>
          <p className="ldr__current">Current Price</p>
          <hr />
          <h1 className="ldr__count">3,000,000</h1>
          <p className="ldr__supply">Circulating Supply</p>
          <hr />
        </div>
      </div>
    );
}
export default exchangeInfoCard
